package aqqje.com.beans;public class God {    private String name;    private int leg;    private Persion persion;    public String getName() {        return name;    }    @Override    public String toString() {        return "God{" +                "name='" + name + '\'' +                ", leg=" + leg +                ", persion=" + persion +                '}';    }    public void setName(String name) {        this.name = name;    }    public void setLeg(int leg) {        this.leg = leg;    }    public void setPersion(Persion persion) {        this.persion = persion;    }    public int getLeg() {        return leg;    }    public Persion getPersion() {        return persion;    }}